import React from "react";

const ListSearch = () => {
  return (
    <div>
      <input list="browsers" name="browser"/>
<datalist id="browsers">
  <option value="Internet Explorer"/>
  <option value="Firefox"/>
  <option value="Chrome"/>
  <option value="Opera"/>
  <option value="Safari"/>
</datalist>
    </div>
  );
};

export default ListSearch;
